import logo from './logo.svg';
import './App.css';

function App() {
  let titles = "방베 맛집";

  return (
    <div className="App">
      <header className="App-header">
       <div style={{color:'blue', fontSize:'20px'}}> 
        홈페이지 개발
      </div>
       <h4> {titles} </h4>
      </header>
    </div>
  );
}

export default App;
